    p5.createCanvas(600, 400);
    //p5.colorMode(p5.HSB); 
  }

  p5.draw = () => {
    draw(p5);
  };
  p5.mousePressed = () => {

  }
  p5.keyPressed = () => {

  }
}


export default function Breath() {
  return <ReactP5Wrapper sketch={sketch} />;
}
